import React from 'react';

const footerList = [
    {
        name:"Powered by Shopify"
    },
    {
        name:"Refund policy"
    },
    {
        name:"Terms of service"
    },
    {
        name:"Shipping Policy"
    }
]
const Footer = () => {
    return(
        <div>
            <hr style={{
                position:"relative",
                bottom:"8vh",
                width:"90vw",
                height:"0vw"
            }} />
        <div
            style={{
                position:"relative",
                fontSize:"1vw",
                width:"100vw",
                bottom:"5vh",
                left:"5vw",
            }}
        >
            {footerList.map((item,i) => (
                <div style={{
                    key:{i},
                    position:"relative",
                    float:"left",
                    marginLeft:"1vw"
                }}>
                    {item.name}
                </div>
            ))}
        </div>
        </div>
    )
}

export default Footer;
